import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <>
            <div>
            <Layout>
                <Head>
                    <title>About</title>
                </Head>         
            </Layout>
            </div>
            <h1>Home</h1> 
        <style jsx>{`
            Layout{
                background: red;
            }
               
            
            `}</style>
        </>
    )
}
export default Home;
